import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

function FeedbackForm() {
  const { formId } = useParams();
  const [form, setForm] = useState(null);
  const [formData, setFormData] = useState({});
  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    axios.get(`http://localhost:5000/api/forms/${formId}`)
      .then(response => {
        setForm(response.data);
      })
      .catch(error => {
        console.error("Error fetching form:", error);
      });
  }, [formId]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    
    setFormData(prevData => {
      // Use question's MongoDB _id as the key (name)
      if (type === 'checkbox') {
        const currentArray = prevData[name] || [];
        return {
          ...prevData,
          [name]: checked 
            ? [...currentArray, value]
            : currentArray.filter(v => v !== value)
        };
      }
      return { ...prevData, [name]: value };
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Structure submission data to include responses mapped by question ID
      const submissionData = {
          ...formData
      };
      
      await axios.post(`http://localhost:5000/api/submissions/${formId}`, submissionData);
      setSubmitted(true);
    } catch (error) {
      console.error("Error submitting form:", error);
      alert('Submission failed. Please try again.');
    }
  };

  if (!form) return <div className="container">Loading form...</div>;
  if (submitted) return <div className="container"><h2>Thank you for your feedback!</h2><p>Your response has been recorded.</p></div>;

  return (
    <div className="container">
      <h2>{form.title}</h2>
      <p>{form.description}</p>
      <form onSubmit={handleSubmit} className="feedback-form">
        {/* Universal fields: Name and Email */}
        <div className="form-group">
          <label>Name (Optional)</label>
          <input type="text" name="name" onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Email (Optional)</label>
          <input type="email" name="email" onChange={handleChange} />
        </div>

        {/* Dynamic Questions */}
        {form.questions.map((q) => {
          const questionKey = q._id.toString();
          return (
            <div key={questionKey} className="form-group">
              <label>{q.questionText}</label>
              
              {q.questionType === 'text' && (
                <textarea name={questionKey} onChange={handleChange} required />
              )}
              
              {q.questionType === 'rating' && (
                <div className="options rating-input">
                  {[1, 2, 3, 4, 5].map(star => (
                    <label key={star}>
                      <input
                        type="radio"
                        name={questionKey}
                        value={star}
                        onChange={handleChange}
                        required
                      /> {star}
                    </label>
                  ))}
                </div>
              )}
              
              {(q.questionType === 'radio' || q.questionType === 'checkbox') && (
                <div className="options">
                  {q.options.map((option, optIndex) => (
                    <label key={optIndex} className={q.questionType}>
                      <input
                        type={q.questionType}
                        name={questionKey}
                        value={option}
                        onChange={handleChange}
                        required={q.questionType === 'radio'} // Only radio must be checked
                      /> {option}
                    </label>
                  ))}
                </div>
              )}
            </div>
          );
        })}
        <button type="submit" className="btn btn-primary">Submit Feedback</button>
      </form>
    </div>
  );
}

export default FeedbackForm;
